    16→    if (!conversationId) {
    17→      return NextResponse.json(
    18→        { error: "conversationId is required" },
    19→        { status: 400 }
    20→      );
    21→    }
    22→
    23→    const result = await db.query.messages.findMany({
    24→      where: eq(messages.conversationId, conversationId),
    25→      orderBy: [asc(messages.createdAt)],
    26→    });
    27→
    28→    return NextResponse.json(result);
    29→  } catch (error) {
    30→    console.error("Error fetching messages:", error);
    31→    return NextResponse.json(
    32→      { error: "Failed to fetch messages" },
    33→      { status: 500 }
    34→    );
    35→  }
    36→}
