     8→
     9→export interface GitHubFile {
    10→  path: string;
    11→  type: "blob" | "tree";
    12→  sha: string;
    13→  size?: number;
    14→  url?: string;
    15→}
    16→
    17→export class GitHubService {
    18→  /**
    19→   * Parse owner, repo, and branch (optional) from a GitHub URL
    20→   */
    21→  static parseUrl(url: string) {
    22→    try {
    23→      const u = new URL(url);
    24→      const parts = u.pathname.split("/").filter(Boolean);
    25→      const owner = parts[0];
    26→      const repo = parts[1];
    27→      // Basic branch detection (heuristic)
    28→      const branch = parts.length > 3 && parts[2] === "tree" ? parts[3] : "main";
    29→      return { owner, repo, branch };
    30→    } catch (e) {
    31→      throw new Error("Invalid GitHub URL");
    32→    }
    33→  }
    34→
    35→  /**
    36→   * Fetch entire repo tree structure (recursive)
    37→   * This is ONE API call for up to 100k files
    38→   */
    39→  static async getRepoTree(owner: string, repo: string, branch = "main"): Promise<GitHubFile[]> {
    40→    try {
    41→      // First get the SHA of the branch to be sure (or just use branch name)
    42→      const { data } = await github.git.getTree({
    43→        owner,
    44→        repo,
    45→        tree_sha: branch,
    46→        recursive: "1",
    47→      });
    48→
    49→      return data.tree.map((f: any) => ({
    50→        path: f.path,
    51→        type: f.type,
    52→        sha: f.sha,
    53→        size: f.size,
    54→        url: f.url
    55→      }));
    56→    } catch (error) {
    57→      // Fallback: maybe branch is 'master'?
    58→      if (branch === "main") {
    59→        try {
    60→          return await this.getRepoTree(owner, repo, "master");
    61→        } catch { /* ignore */ }
    62→      }
    63→      console.error("Failed to fetch repo tree:", error);
    64→      throw new Error("Could not fetch repository structure. Is the repo public?");
    65→    }
    66→  }
    67→
    68→  /**
    69→   * Fetch file content using jsDelivr CDN (Fast, No Rate Limit)
    70→   * Fallback to GitHub API if CDN fails (e.g. private repo or cache miss)
    71→   */
    72→  static async getFileContent(owner: string, repo: string, path: string, branch = "main"): Promise<string> {
    73→    // 1. Try CDN first (Super fast)
    74→    try {
    75→      const cdnUrl = `https://cdn.jsdelivr.net/gh/${owner}/${repo}@${branch}/${path}`;
    76→      const res = await fetch(cdnUrl);
    77→      if (res.ok) {
    78→        return await res.text();
    79→      }
    80→    } catch (e) {
    81→      // CDN failed, continue to API
    82→    }
    83→
    84→    // 2. Fallback to GitHub API
    85→    try {
    86→      const { data } = await github.repos.getContent({
    87→        owner,
    88→        repo,
    89→        path,
    90→        ref: branch,
    91→      });
    92→
    93→      if (!Array.isArray(data) && "content" in data) {
    94→        return Buffer.from(data.content, "base64").toString("utf-8");
    95→      }
    96→    } catch (e) {
    97→      console.error(`Failed to fetch content for ${path}:`, e);
    98→    }
    99→    
   100→    return "";
   101→  }
   102→
   103→  /**
   104→   * Filter tree for relevant files (in-memory)
   105→   */
   106→  static filterRelevantFiles(files: GitHubFile[]) {
   107→    return {
   108→        // Source code (limit to top 200 to avoid context overflow)
   109→        components: files.filter(f => 
   110→            f.type === "blob" && 
   111→            /\.(tsx|jsx|vue|svelte)$/.test(f.path) &&
   112→            !f.path.includes("node_modules") &&
   113→            !f.path.includes("dist") &&
   114→            !f.path.includes("test")
   115→        ).slice(0, 50), // Only analyze top 50 components for speed/context
   116→
   117→        // Configs
   118→        configs: files.filter(f => 
   119→            f.path === "package.json" || 
   120→            f.path === "tsconfig.json" || 
   121→            f.path.includes("tailwind.config")
   122→        ),
   123→        
   124→        // Context
   125→        docs: files.filter(f => f.path.toLowerCase() === "readme.md")
   126→    };
   127→  }
   128→}
